TC.i18n = TC.i18n || i18n;

/**
 * Entidad geográfica que representa un marcador (punto con un icono asociado) del mapa.
 * @class Marker
 * @memberof SITNA.feature
 * @extends SITNA.feature.Point
 * @param {number[]} coordinates - Coordenadas del punto expresadas en las unidades del CRS del mapa.
 * @param {SITNA.feature.MarkerOptions} [options] Objeto de opciones de marcador.
 * @see SITNA.Map#addMarker
 * @see SITNA.layer.Vector#addMarker
 * @see SITNA.layer.Vector#addMarkers
 * @see SITNA.layer.Vector#addFeature
 * @see SITNA.layer.Vector#addFeatures
 * @see [Ejemplo de uso de métodos de entidad geográfica](../examples/feature.methods.html)
 * @example <caption>[Ver en vivo](../examples/feature.Marker.html)</caption> {@lang html}
<div id="mapa"></div>
<script>
    SITNA.Cfg.workLayers = [
        {
            id: "entidades",
            title: "Demostración de uso de métodos de entidades geográficas",
            type: SITNA.Consts.layerType.VECTOR
        }
    ];
    var map = new SITNA.Map("mapa");
    map.loaded(() => {
        // Obtenemos la instancia de la capa vectorial
        const vectorLayer = map.getLayer("entidades");

        // Añadimos una instancia de la clase SITNA.feature.Marker
        const school1 = new SITNA.feature.Marker([611059.0, 4741572.7], {
            anchor: [0, 1], // Punto de anclaje en la esquina inferior izquierda
            url: 'data/speech-icon.png',
            width: 32,
            height: 32, // 32x32 pixels
            data: {
                'Centro': 'Escuela Oficial de Idiomas de Pamplona'
            }
        });
        vectorLayer.addMarker(school1);

        // Añadimos una entidad geográfica introduciendo directamente las coordenadas de su geometría
        vectorLayer.addMarker([615502.2, 4657758.4], {
            anchor: [0, 1], // Punto de anclaje en la esquina inferior izquierda
            url: 'data/speech-icon.png',
            width: 32,
            height: 32, // 32x32 pixels
            data: {
                'Centro': 'Escuela Oficial de Idiomas de Tudela'
            }
        });
    });
</script>
 */

/**
 * Establece las coordenadas del punto en el CRS actual del mapa.
 * @method setCoordinates
 * @memberof SITNA.feature.Marker
 * @instance
 * @param {number[]} coordinates - Coordenadas del punto en el CRS actual del mapa.
 * @returns {SITNA.feature.Marker} La propia entidad geográfica.
 */

/**
 * Obtiene el estilo de la entidad.
 * @method getStyle
 * @memberof SITNA.feature.Marker
 * @instance
 * @returns {SITNA.feature.MarkerStyleOptions}
 */

/**
 * Asigna estilos al marcador.
 * @method setStyle
 * @memberof SITNA.feature.Marker
 * @instance
 * @param {SITNA.feature.MarkerStyleOptions} style - Objeto de opciones de estilo de marcador.
 * @returns {SITNA.feature.Marker} La propia entidad geográfica.
 */

class Marker extends Point {
    STYLETYPE = 'marker';

    constructor(coords, options) {
        super(coords, options);

        if (!this.wrap.isNative(coords)) {
            const locale = this.layer?.map ? this.layer.map.options.locale : Cfg.locale;
            this.title = this.options.title || TC.i18n[locale][Consts.MARKER];
            this.wrap.createMarker(coords, options);
        }
    }
}

export default Marker;

/**
 * Opciones de estilo de marcador (punto con un icono). Para determinar qué icono se va a asignar al marcador, se leen las propiedades `url` y `cssClass`, en ese orden de preferencia.
 * Hay que tener en cuenta que el archivo `config.json` de una maquetación puede sobreescribir los valores por defecto de esta propiedad
 * (para ver instrucciones de uso de maquetaciones, consultar {@tutorial layout_cfg}).
 * @typedef MarkerStyleOptions
 * @memberof SITNA.feature
 * @mixin
 * @mixes SITNA.feature.LabelStyleOptions
 * @see SITNA.layer.StyleOptions
 * @see layout_cfg
 * @property {number[]} [anchor=[0.5, 1]] - Posicionamiento relativo del icono respecto al punto del mapa, representado por un array de dos números entre 0 y 1, siendo [0, 0] la esquina superior izquierda del icono y [1, 1] la esquina inferior derecha del icono.
 * @property {string} [labelRotationKey] - Nombre del campo del cual extraer la rotación a aplicar a la etiqueta. El valor tiene que estar en grados.
 * @property {string[]} [classes=["tc-marker1", "tc-marker2", "tc-marker3", "tc-marker4", "tc-marker5"]] - 
 * Lista de nombres de clase CSS a utilizar para asignar iconos a los marcadores según grupo
 * (Ver propiedad `group` de {@link SITNA.feature.MarkerOptions}). Cuando se añade un nuevo grupo de marcadores, se le asignará la clase correspondiente
 * al siguiente elemento del array. Si hay más grupos que elementos en `classes`, se repite el ciclo a lo largo
 * del array. La API extraerá la URL de la imagen del atributo `background-image` de la clase CSS asignada.
 * [Ver ejemplo de uso](../examples/cfg.MarkerOptions.2.html).
 * @property {string} [cssClass] - Nombre de una clase CSS. El marcador adoptará como icono el valor del atributo `background-image` de dicha clase.
 * @property {string} [fontColor="#000000"] - Color del texto de la etiqueta descriptiva del marcador, representado en formato hex triplet (`#RRGGBB`).
 * @property {number} [fontSize=10] - Tamaño en puntos tipográficos (`pt`) de la fuente del texto de la etiqueta descriptiva del marcador.
 * @property {number} [height=32] - Altura en píxeles del icono.
 * Nombre de atributo del cual extraer el valor de la etiqueta si esta existe.
 * @property {string} [labelkey] - Nombre de atributo del cual extraer el valor de la etiqueta si esta existe.
 * @property {string} [labelOutlineColor="#ffffff"] - Color del contorno del texto de la etiqueta descriptiva del marcador, representado en formato hex triplet (`#RRGGBB`).
 * @property {number} [labelOutlineWidth=2] - Anchura en píxeles del trazo del contorno del texto de la etiqueta.
 * @property {string} [url] - URL de archivo de imagen que se utilizará para el icono.
 * @property {number} [width=32] - Anchura en píxeles del icono.
 */

/**
 * Opciones de marcador (punto con un icono). Para determinar qué icono se va a asignar al marcador, se leen las propiedades `url`, `cssClass` `group`, en ese orden de preferencia.
 * Hay que tener en cuenta que el archivo `config.json` de una maquetación puede sobreescribir los valores por defecto de esta propiedad
 * (para ver instrucciones de uso de maquetaciones, consultar {@tutorial layout_cfg}).
 * @typedef MarkerOptions
 * @memberof SITNA.feature
 * @extends SITNA.feature.FeatureOptions
 * @mixes SITNA.feature.MarkerStyleOptions
 * @see SITNA.Map#addMarker
 * @property {number[]} [anchor=[0.5, 1]] - Posicionamiento relativo del icono respecto al punto del mapa, representado por un array de dos números entre 0 y 1, siendo [0, 0] la esquina superior izquierda del icono y [1, 1] la esquina inferior derecha del icono.
 * @property {string} [angle] - *__Obsoleta__: En lugar de esta propiedad utilice la propiedad equivalente `labelRotationKey`.*
 * 
 * Nombre del campo del cual extraer la rotación a aplicar a la etiqueta. El valor tiene que estar en grados.
 * @property {string[]} [classes=["tc-marker1", "tc-marker2", "tc-marker3", "tc-marker4", "tc-marker5"]] - 
 * Lista de nombres de clase CSS a utilizar para asignar iconos a los marcadores según grupo 
 * (Ver propiedad `group`). Cuando se añade un nuevo grupo de marcadores, se le asignará la clase correspondiente 
 * al siguiente elemento del array. Si hay más grupos que elementos en `classes`, se repite el ciclo a lo largo 
 * del array. La API extraerá la URL de la imagen del atributo `background-image` de la clase CSS asignada.
 * [Ver ejemplo de uso](../examples/cfg.MarkerOptions.2.html).
 * @property {string} [cssClass] - Nombre de una clase CSS. El marcador adoptará como icono el valor del atributo `background-image` de dicha clase.
 * @property {object|string} [data] - Diccionario de pares clave-valor que representa los atributos alfanuméricos del marcador o bien cadena de caracteres con el código HTML asociado al mismo. Al pulsar sobre el marcador, bien una tabla con los atributos o bien el HTML especificado se mostrarán en un bocadillo.
 * @property {string} [fontColor="#000000"] - Color del texto de la etiqueta descriptiva del marcador, representado en formato hex triplet (`#RRGGBB`).
 * @property {number} [fontSize=10] - Tamaño en puntos tipográficos (`pt`) de la fuente del texto de la etiqueta descriptiva del marcador.
 * @property {string} [group] - Nombre de grupo en el que incluir el marcador. Todos los marcadores con el mismo valor en esta propiedad se consideran en un mismo grupo, y
 * con ello comparten el mismo icono. El icono se selecciona por orden de la lista de clases CSS definida en `classes`. Los grupos se muestran en la tabla de contenidos y en la leyenda.
 * @property {number} [height=32] - Altura en píxeles del icono.
 * @property {string} [label] - *__Obsoleta__: En lugar de esta propiedad utilice la propiedad equivalente `labelKey`.*
 * 
 * Nombre de atributo del cual extraer el valor de la etiqueta si esta existe.
 * @property {string} [labelKey] - Nombre de atributo del cual extraer el valor de la etiqueta si esta existe.
 * @property {string} [labelOutlineColor="#ffffff"] - Color del contorno del texto de la etiqueta descriptiva del marcador, representado en formato hex triplet (`#RRGGBB`).
 * @property {number} [labelOutlineWidth=2] - Anchura en píxeles del trazo del contorno del texto de la etiqueta.
 * @property {string} [labelRotationKey] - Nombre del campo del cual extraer la rotación a aplicar a la etiqueta. El valor tiene que estar en grados.
 * @property {string} [layer] - Esta propiedad se utiliza en {@link SITNA.Map#addMarker}. Es el identificador de una capa de tipo [SITNA.Consts.layerType.VECTOR]{@link SITNA.Consts} en la que se añadirá el marcador.
 * Si no se especifica se creará una capa específica para los marcadores que se añadan por este método.
 * @property {boolean} [showPopup] - Si se establece a `true`, el marcador se añade al mapa con el bocadillo de información asociada visible por defecto.
 * @property {string} [url] - URL de archivo de imagen que se utilizará para el icono.
 * @property {number} [width=32] - Anchura en píxeles del icono.
 * @example <caption>Ejemplo del uso de contenido HTML en la propiedad `data` [Ver en vivo](../examples/cfg.MarkerOptions.html)</caption> {@lang html}
 * <div id="mapa"></div>
 * <script>
 *     // Crear mapa.
 *       var map = new SITNA.Map("mapa");
 *
 *       // Cuando esté todo cargado proceder a trabajar con el mapa.
 *       map.loaded(function () {
 *           // Añadir un marcador.
 *           map.addMarker([610848, 4741533], {
 *                 data: '<h3>Ayuntamiento de Pamplona</h3><img width="500" src="data:image/jpeg;base64,"/>'
 *           });
 *           // Centrar el mapa en el marcador.
 *           map.zoomToMarkers();
 *       });
 * </script>
 * @example <caption>Ejemplo del uso de las propiedades `classes` y `group` [Ver en vivo](../examples/cfg.MarkerOptions.2.html)</caption> {@lang html}
 * <style>
 *     .firstIcon {
 *         background-image: url('data/star.png');
 *     }
 *     .secondIcon {
 *         background-image: url('data/circle.png');
 *     }
 *     .thirdIcon {
 *         background-image: url('data/triangle.png');
 *     }
 * </style>
 * <div id="mapa"></div>
 * <script>
 *     // Crear mapa.
 *       var map = new SITNA.Map("mapa");
 *
 *       // Cuando esté todo cargado proceder a trabajar con el mapa.
 *       map.loaded(function () {
 *           // Lista de clases CSS que tienen una propiedad 'backgroung-image' establecida
 *           const iconClassList = ["firstIcon", "secondIcon", "thirdIcon"];
 *           // Añadir un marcador.
 *           map.addMarker([609299, 4740700], {
 *               classes: classList,
 *               group: "Cines" // Primer grupo que se ha definido: este marcador tendrá el icono star.png
 *           });
 *           map.addMarker([610681, 4741659], {
 *               classes: iconClassList,
 *               group: "Museos" // Segundo grupo que se ha definido: este marcador tendrá el icono circle.png
 *           });
 *           map.addMarker([610865, 4741600], {
 *               classes: iconClassList,
 *               group: "Instalaciones deportivas" // Tercer grupo que se ha definido: este marcador tendrá el icono triangle.png
 *           });
 *           map.addMarker([611246, 4741403], {
 *               classes: iconClassList,
 *               group: "Instalaciones deportivas" // Grupo definido antes, compartirá icono con el otro marcador del mismo grupo
 *           });
 *           map.addMarker([610280, 4741340], {
 *               classes: iconClassList,
 *               group: "Parques" // Cuarto grupo que se ha definido: vuelve a empezar el ciclo, este marcador tendrá el icono star.png
 *           });
 *           // Centrar el mapa en los marcadores.
 *           map.zoomToMarkers();
 *       });
 * </script>
 */